import axios from "axios";
import { useRef, useState } from "react";
import $ from 'jquery';
import Swal from "sweetalert2";
import { Routes, Route, Outlet, Link ,Navigate,redirect,useNavigate   } from "react-router-dom";

function Auth(){
    const refUser = useRef();
    const refPass = useRef();
    const [stateUsr,setUser] = useState(null);
    const [stateLogin,setStateLogin] = useState(null);
    const [loginStatus , setloginStatus] = useState(null);
    const navigate = useNavigate();
    const logon = () =>{
        const bodyData = JSON.stringify({"pwaUser" : refUser.current.value,"pwaPass" : refPass.current.value});
        axios.post('https://reg2.pwa.co.th/cors_service/res.php',bodyData)
        .then(res => {
          const pwaStaff = res.data;
          if(pwaStaff.status == "success"){
            //console.log(pwaStaff)
          }else if(pwaStaff.status == "notsuccess"){
            sessionStorage.clear();
          }
          if(pwaStaff.status == "success"){
            sessionStorage.setItem("PWAusr", pwaStaff.username);
            sessionStorage.setItem("PWAstaffname", pwaStaff.firstname + " " +pwaStaff.lastname);
            sessionStorage.setItem("PWAusr", pwaStaff.username);
            sessionStorage.setItem("APIStatus", pwaStaff.status);
            sessionStorage.setItem("PWALoginStatus", pwaStaff.status_desc);
            sessionStorage.setItem("PWALoginInfo", pwaStaff);
            Swal.fire({
                icon: 'success',
                title: 'Login Success',
                text: 'เข้าสู่ระบบสำเร็จ',
              }).then((result) => {
                /* Read more about isConfirmed, isDenied below */
                if (result.isConfirmed) {
                    navigate('/meterMal');
                } else if (result.isDenied) {
                  Swal.fire('ยกเลิก', '', 'error');
                  sessionStorage.clear();
                }
            });
            
        }else{
            Swal.fire({
                icon: 'error',
                title: 'Login Failed',
                text: 'username หรือ รหัสผ่านไม่ถูกต้อง กรุณาลองใหม่อีกครั้ง',
              })
            navigate('/');
            }
        })


    }
    return(
        <div>
            <div className="iamge"></div>
                    <div className="sign-in">
                        <div className="logincontainer d-flex justify-content-center align-items-center bg--primary">
                            <div className="login__card d-flex flex-direction-column justify-content-center align-items-center border-radius--lg bg--secondary">
                                
                                <br/>
                                <h4 className="title margin-buttom color--primary">เข้าสู่ระบบ</h4>
                                    <div className="login__username d-flex align-items-center margin-buttom border-radius bg--white">
                                    <span className="d-flex bg--primary border-radius--left">
                                        <i className="fa fa-user color--tertionary margin-auto" />
                                    </span>
                                    <span>
                                        <input className="color--tertionary border-radius" type="text" ref={refUser} id='usrname' />
                                    </span>
                                    </div>
                                    <div className="login__password d-flex align-items-center margin-buttom border-radius bg--white">
                                    <span className="d-flex bg--primary border-radius--left">
                                        <i className="fa fa-lock color--tertionary margin-auto" />
                                    </span>
                                    <span>
                                        <input className="color--tertionary border-radius" type="password" ref={refPass} id='passwd' />
                                    </span>
                                    </div>
                                        <button className="login__btn border-radius bg--primary color--tertionary margin-buttom-sm" onClick={logon}>Login</button>
                                    <div>
                                    <div className="login__using__title d-flex  align-items-center margin-buttom-sm color--primary">
                                        <span>{loginStatus}</span>
                                    </div>
                                    <div className="login__using__title d-flex  align-items-center margin-buttom-sm color--primary">
                                        <hr className="bg--primary border-radius--round" />
                                        PWA 2 Authen
                                        <hr className="bg--primary border-radius--round" />
                                    </div>
                                    <div className="login__using d-flex justify-content-space-evenly">
                                    </div>
                                    </div>
                            </div>
                        </div>
                    </div>
        </div>
    );
}

export default Auth;
